import React from 'react';
import { Slider, SliderInput, SliderTrackHighlight, SliderMarker, SliderTrack, SliderHandle} from "@reach/slider";


export default () => (
    <div>
    <SliderInput>
        <SliderTrack>
          <SliderTrackHighlight />
          <SliderMarker value={50} />
          <SliderHandle />
        </SliderTrack>
      </SliderInput>
    </div>
  );
